\begin{equation}
 ds^2 (M_{10}) = -dT^2 + dX^2 + dY^2 + dR^2 + R^2 d \Phi^2 + ds^2(M_5).
\

\begin{equation}
 \begin{array}{ccl}
   T & = & t      \\
   X & = & x + cy \\
   Y & = & y      \\
  \Phi & = & \phi
 \end{array}
\

\begin{equation}
 G_{ij} \equiv \frac{\partial X^\mu}{\partial x^i} \frac{\partial X^\nu}{\partial x^j} G_{\mu \nu} = 
 \left(
  \begin{array}{cccc}
   -1 & 0 & 0       & 0   \\
    0 & 1 & c       & 0   \\
    0 & c & 1 + c^2 & 0   \\
    0 & 0 & 0       & R^2
  \end{array}
 \right)
 \label{eq:metric}
\

\begin{equation}
 F_{ij} = 
 \left(
  \begin{array}{cccc}
    0        & -E_x      & -E_y        & -E_{\phi} \\
    E_x      &  0        &  R B^{\phi} & -R B^y    \\
    E_y      & -R B^\phi &  0          &  R B^x    \\
    E_{\phi} &  R B^y    & -R B^x      &  0
  \end{array}
 \right).
 \label{eq:fieldstrength}
\

\begin{equation}
 H^2 = \frac{1}{(2 \pi)^2} \left\{ 1 + \frac{1}{lambda_2} (D, \, B)
 \left(
  \begin{array}{cc}
   1 & lambda_1 \\
   lambda_1 & |lambda|^2
  \end{array}
 \right)
 \left(
  \begin{array}{c}
   D \\ B
  \end{array}
 \right)
 + |D \times B|^2 \right\}.
 \label{eq:finalhamiltonian}
\

\begin{equation}
 R^2 = \frac{\left| n^x m^y - n^y m^x \right|}{L_x L_y},
\

\begin{equation}
 \left| 
  \begin{array}{ll}
   n^x & n^y \\
   m^x & m^y
  \end{array}
 \right|
 = |n^x m^y - n^y m^x| = 1
 \label{eq:determinant}
\

\begin{equation}
